import React, {useEffect, useState} from 'react'
import './catFacts.css'

export const CatFacts = () => {
  const [facts, setFacts] = useState([]);

  useEffect(() => {
    console.log(facts)
  },)

  const update = () => {

      const newFact =  fetch('https://cat-fact.herokuapp.com/facts/random');
      const fact =  newFact.text;

      return  fact;

  }

  return (
    <div>
      <button id='btn' onClick={() => setFacts(facts => [...facts, update])}></button>
      <ul>{facts.map((entry, i) => {
        console.log(entry);
        <li key={i}>{entry}</li>
      })}
      </ul>
    </div>
  )
}
